description:
   Discovery  Pro  is  a  12 oscillator Virtual Analog Synthesizer featuring 4 layers,  WAV  and  SoundFont  (SF2)  support,  PADSynth,  2X oversampling / undersampling,  built-in  arpeggiator,  sync,  FM, 12 filter types, panning modulation,  stereo  delay  and  gate effects, graphic envelope modulation. Imports and exports Nord Lead 2 SysEx data. 


   Compatibility: 

   (WIN) VST,RTAS &gt; 32bit and 64bit  

   (OSX) VST,AU,RTAS &gt; 32bit and 64bit 

